uent of ribosome","F:RNA binding","","F:ribosome binding","F:DNA binding","F:tRNA (guanine(37)-N(1))-methyltransferase activity","F:structural constituent of ribosome"],"Keywords":["Cytoplasm, GTP-binding, Nucleotide-binding, RNA-binding, Ribonucleoprotein, Signal recognition particle","Ribonucleoprotein, Ribosomal protein","Cell shape, Cell wall biogenesis/degradation, Chaperone, Cytoplasm, RNA-binding","Coiled coil","Chaperone, Cytoplasm, Ribosome biogenesis","DNA-binding","Cytoplasm, Methyltransferase, S-adenosyl-L-methionine, Transferase, tRNA processing","Ribonucleoprotein, Ribosomal protein"],"Name":["signal recognition particle protein","30S ribosomal protein S16","KH domain-containing protein","YlqD family protein","ribosome maturation factor RimM","putative DNA-binding protein","tRNA (guanosine(37)-N1)-methyltransferase TrmD","50S ribosomal protein L19"],"Predicted membrane protein":["No","No","No","No","No","No","No","No"],"Structure":["https://swissmodel.expasy.org/repository/uniprot/K9TGU3","https://swissmodel.expasy.org/repository/uniprot/K9SB13","https://swissmodel.expasy.org/repository/uniprot/K9SC83","https://swissmodel.expasy.org/repository/uniprot/A0A2P8HY95","https://swissmodel.expasy.org/repository/uniprot/A0A109RGK7","https://swissmodel.expasy.org/repository/uniprot/A0A0X8FKF8","https://swissmodel.expasy.org/repository/uniprot/A0A120IAR7","https://swissmodel.expasy.org/repository/uniprot/A0A0X8FLQ7"],"UniprotKB":["K9TGU3","K9SB13","K9SC83","A0A2P8HY95","A0A109RGK7","A0A0X8FKF8","A0A120IAR7","A0A0X8FLQ7"],"index":[0,2,3,4,5,1,6,7]},"selected":{"id":"59743","type":"Selection"},"selection_policy":{"id":"59744","type":"UnionRenderers"}},"id":"59259","type":"ColumnDataSource"},{"attributes":{"source":{"id":"59172","type":"ColumnDataSource"}},"id":"59176","type":"CDSView"},{"attributes":{"fill_color":"rgb(244, 250, 174)","x":{"field":"x"},"y":{"field":"y"}},"id":"59178","type":"Patch"},{"attributes":{"data_source":{"id":"58352","type":"ColumnDataSourc
